<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="The-Virtual-DataFrame">The Virtual DataFrame<a class="anchor-link" href="#The-Virtual-DataFrame">&#182;</a></h1>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>The Virtual DataFrame is the main object of the library. It is the perfect transition from small to Big Data. The principle is quite simple. As Vertica is a powerful columnar MPP DataBase with many built-in function, Vertica is a veritable asset to do heavy computations.</p>
<p>Indeed, columnar orientation allows high compression and it will also avoid useless parsing to retrieve the data. The MPP (Massive Parallel Processing) allows to parallelize all the computations accross the different nodes.</p>
<p>Instead of working in memory where many limitations avoid to work properly on huge volumes of data, Vertica ML Python takes the advantage of Vertica scalability to push all the heavy computations to the platform which will aggregate and return the final result. <br></p>
<br><center>
  <img src="../../../img/vertica-ml-python.png" width="80%" style="min-width: 300px;">
</center><br>
<p>Thanks to Python flexibility, it is then easy to add many abstractions to help users simplifying the entire process. The vDataFrame is an abstraction which will help any user to enjoy doing the Data Science cycle entirely inside the Vertica DataBase.</p>
<p>To understand the object, there is nothing better than examples.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="vDataFrame-Creation">vDataFrame Creation<a class="anchor-link" href="#vDataFrame-Creation">&#182;</a></h1>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>There are 2 main ways to create a vDataFrame.</p>
<p>The first one is to directly create a vDataFrame using an existing relation.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[1]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python</span> <span class="k">import</span> <span class="n">vDataFrame</span>
<span class="kn">from</span> <span class="nn">vertica_ml_python</span> <span class="k">import</span> <span class="n">vertica_cursor</span>

<span class="n">cur</span> <span class="o">=</span> <span class="n">vertica_cursor</span><span class="p">(</span><span class="s2">&quot;VerticaDSN&quot;</span><span class="p">)</span>

<span class="n">vDataFrame</span><span class="p">(</span><span class="s2">&quot;public.titanic&quot;</span><span class="p">,</span> <span class="n">cur</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

