<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>It took less than a second to create a vDataFrame. The data are stored in the Vertica DataBase and nothing is loaded in-memory. Indeed, this dataset will consume more than 6GB of memory which can be very expensive for a personal machine. You can try to load the entire dataset in your computer if you have at least 8GB of memory (you can find it by clicking <a href="https://www.kaggle.com/c/expedia-hotel-recommendations">here</a>). In my case, my computer did not succeed to load the entire dataset.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[51]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">import</span> <span class="nn">pandas</span> <span class="k">as</span> <span class="nn">pd</span>

<span class="n">L_nrows</span> <span class="o">=</span> <span class="p">[</span><span class="mi">10000</span><span class="p">,</span> <span class="mi">100000</span><span class="p">,</span> <span class="mi">1000000</span><span class="p">,</span> <span class="mi">2000000</span><span class="p">,</span> <span class="mi">5000000</span><span class="p">,</span> <span class="mi">10000000</span><span class="p">,</span> <span class="mi">20000000</span><span class="p">]</span>
<span class="n">L_time</span> <span class="o">=</span> <span class="p">[]</span>
<span class="k">for</span> <span class="n">nrows</span> <span class="ow">in</span> <span class="n">L_nrows</span><span class="p">:</span>
    <span class="n">start_time</span> <span class="o">=</span> <span class="n">time</span><span class="o">.</span><span class="n">time</span><span class="p">()</span>
    <span class="n">expedia_df</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">read_csv</span><span class="p">(</span><span class="s2">&quot;expedia.csv&quot;</span><span class="p">,</span> <span class="n">nrows</span> <span class="o">=</span> <span class="n">nrows</span><span class="p">)</span>
    <span class="n">elapsed_time</span> <span class="o">=</span> <span class="n">time</span><span class="o">.</span><span class="n">time</span><span class="p">()</span> <span class="o">-</span> <span class="n">start_time</span>
    <span class="n">L_time</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">elapsed_time</span><span class="p">)</span>
    <span class="nb">print</span><span class="p">(</span><span class="s2">&quot;nrows = </span><span class="si">{}</span><span class="s2">; elapsed time = </span><span class="si">{}</span><span class="s2">&quot;</span><span class="o">.</span><span class="n">format</span><span class="p">(</span><span class="n">nrows</span><span class="p">,</span> <span class="n">elapsed_time</span><span class="p">))</span>
</pre></div>

</div>
</div>
</div>

