02em;background-color:#214579;color:white"><b>"user_location_region"</b></td><td style="border: 1px solid white;">1728</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>"hotel_market"</b></td><td style="border: 1px solid white;">1720</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>"hotel_country"</b></td><td style="border: 1px solid white;">1721</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>"srch_co"</b></td><td style="border: 1px solid white;">1715</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>"is_booking"</b></td><td style="border: 1px solid white;">1718</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>"orig_destination_distance"</b></td><td style="border: 1px solid white;">1733</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>"hotel_continent"</b></td><td style="border: 1px solid white;">1723</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>"site_name"</b></td><td style="border: 1px solid white;">1717</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>total</b></td><td style="border: 1px solid white;">42282</td></tr></table>
