<div class=" highlight hl-ipython3"><pre><span></span><span class="n">expedia</span><span class="p">[</span><span class="s2">&quot;is_booking&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">describe</span><span class="p">()</span>
