<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Each vColumn has its own catalog to save the user modifications.
For example, we previously computed some aggregations for the column 'is_booking'. Let's look at the catalog of the vColumn.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[8]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">expedia</span><span class="p">[</span><span class="s2">&quot;is_booking&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">catalog</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt output_prompt">Out[8]:</div>




