</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>It will save the most important aggregations to not recompute them twice. The catalog will be updated in case of major vDataFrame modifications.</p>
<p>To look at the back-end SQL code generation, it is possible to turn on the SQL using the 'sql_on_off' method.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[5]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">expedia</span><span class="o">.</span><span class="n">sql_on_off</span><span class="p">()</span>
<span class="n">expedia</span><span class="p">[</span><span class="s2">&quot;cnt&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">describe</span><span class="p">()</span>
</pre></div>

</div>
</div>
