<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>You can also display the elapsed time of the different queries using the 'time_on_off' method of the vDataFrame. Let's for example compute the correlation matrix of the vDataFrame.</p>
<p><b>N.B.</b> : In order to display matplotlib graphics in Jupyter, you'll probably need to use the '%matplotlib inline' command the first time you decide to draw a graphic.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[6]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="o">%</span><span class="k">matplotlib</span> inline
<span class="n">expedia</span><span class="o">.</span><span class="n">time_on_off</span><span class="p">()</span>
<span class="n">expedia</span><span class="o">.</span><span class="n">corr</span><span class="p">()</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

