<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can turn off the different functions to display the elapsed time and the SQL code generation by calling them again.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[&nbsp;]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">expedia</span><span class="o">.</span><span class="n">sql_on_off</span><span class="p">()</span>
<span class="n">expedia</span><span class="o">.</span><span class="n">time_on_off</span><span class="p">()</span>
</pre></div>

</div>
