     COALESCE(&#34;orig_destination_distance&#34;, 1970.0900267207) AS &#34;orig_destination_distance&#34;,
     &#34;hotel_continent&#34;,
     &#34;site_name&#34;,
     &#34;user_location_region&#34; 
   FROM
 (
   SELECT
     &#34;is_mobile&#34;,
     &#34;srch_adults_cnt&#34;,
     &#34;user_location_country&#34;,
     &#34;srch_destination_type_id&#34;,
     &#34;srch_rm_cnt&#34;,
     &#34;posa_continent&#34;,
     &#34;srch_ci&#34;,
     &#34;date_time&#34;,
     &#34;cnt&#34;,
     &#34;user_location_city&#34;,
     &#34;user_id&#34;,
     &#34;srch_children_cnt&#34;,
     &#34;channel&#34;,
     &#34;hotel_cluster&#34;,
     &#34;srch_destination_id&#34;,
     &#34;hotel_market&#34;,
     &#34;hotel_country&#34;,
     &#34;srch_co&#34;,
     &#34;is_booking&#34;,
     &#34;orig_destination_distance&#34;,
     &#34;hotel_continent&#34;,
     &#34;site_name&#34;,
     &#34;user_location_region&#34; 
   FROM
 &#34;public&#34;.&#34;expedia&#34;) 
VERTICA_ML_PYTHON_SUBTABLE) 
VERTICA_ML_PYTHON_SUBTABLE
</pre>
</div>
</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can notice that dropping a vColumn leads to not selecting it in the SQL statement. Imputing a vColumn leads to the usage of the 'COALESCE' SQL function. Vertica ML Python will then simplify the entire Data Science cycle by helping the user to access to many easy abstractions.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="vDataFrame-Attributes-and-Management">vDataFrame Attributes and Management<a class="anchor-link" href="#vDataFrame-Attributes-and-Management">&#182;</a></h2><p>As saw before, the vDataFrame has many attributes and methods. vDataFrames have two types of attributes:</p>
<ul class="ul_content">
<li>Virtual Columns</li>
<li>Main Attributes (cursor, main_relation ...)</li>
</ul>
<p>The vDataFrame main attributes are stored in the _VERTICA_ML_PYTHON<em>VARIABLES</em> dictionary.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[5]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">expedia</span><span class="o">.</span><span class="n">_VERTICA_ML_PYTHON_VARIABLES_</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt output_prompt">Out[5]:</div>




<div class="output_text output_subarea output_execute_result">
