<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>You can change them manually if you master the object. Otherwise some methods are available to simplify the process. You can use the methods set_cursor and set_dsn to change the current vDataFrame Vertica DataBase cursor and DSN.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[&nbsp;]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python</span> <span class="k">import</span> <span class="n">vertica_cursor</span>
<span class="n">new_cursor</span> <span class="o">=</span> <span class="n">vertica_cursor</span><span class="p">(</span><span class="s2">&quot;VerticaDSN&quot;</span><span class="p">)</span>
<span class="n">expedia</span><span class="o">.</span><span class="n">set_cursor</span><span class="p">(</span><span class="n">new_cursor</span><span class="p">)</span>
<span class="n">expedia</span><span class="o">.</span><span class="n">set_dsn</span><span class="p">(</span><span class="s2">&quot;VerticaDSN&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="vDataFrame-Data-Types">vDataFrame Data Types<a class="anchor-link" href="#vDataFrame-Data-Types">&#182;</a></h2><p>The vDataFrame is using the vColumns data types to automate the process of its different abstractions. Computing an histogram for a numerical data type is not the same as computing one other for a categorical data type. The vDataFrame will identify 4 main categories.</p>
<ul class="ul_content">
<li>int: integers are treated like categorical when their cardinality is low otherwise they will be considered as numeric.</li>
<li>float: numerics.</li>
<li>date: date like data types.</li>
<li>text: categorical data types.</li>
</ul>
<p>Other data types may be treated automatically as categorical. It is possible to look at the different data types using the 'dtypes' method.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[10]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">expedia</span><span class="o">.</span><span class="n">dtypes</span><span class="p">()</span>
</pre></div>

</div>
</div>
</div>

