<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="Exporting-/-Saving-/-Loading-a-vDataFrame">Exporting / Saving / Loading a vDataFrame<a class="anchor-link" href="#Exporting-/-Saving-/-Loading-a-vDataFrame">&#182;</a></h2><p>The vDataFrame has also many functionalities to simplify its usage. For example, the functions 'save' and 'load' allow the user to save vDataFrame structure to load it later if needed.</p>

